INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (32, 'Kotlin в действии', 'Язык Kotlin предлагает выразительный синтаксис, мощную и понятную систему типов, великолепную поддержку и бесшовную совместимость с существующим кодом на Java, богатый выбор библиотек и фреймворков.', 'Дмитрий Жемеров, Светлана Исакова', '978-5-97060-497-7', 2017, 0, '1020949847.JPG', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (33, 'Spring в действии', 'Фреймворк Spring Framework - необходимый инструмент для разработчиков приложений на Java. В книге описана последняя версия Spring 3, который несет в себе новые мощные особенности, такие как язык выражений SpEL, новые аннотации для работы с контейнером IоС и поддержка архитектуры REST.', 'Крейг Уоллс', '978-5-97060-171-6', 2015, 0, '1011544770.jpg', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (43, 'Разработка Backbone.js приложений', 'Backbone - это javascript-библиотека для тяжелых фронтэнд javascript-приложений, таких, например, как gmail или twitter. В таких приложениях вся логика интерфейса ложится на браузер, что дает очень значительное преимущество в скорости интерфейса. Цель этой книги - стать удобным источником информации в помощь тем, кто разрабатывает реальные приложения с использованием Backbone. ', 'Эдди Османи', '978-5-496-00962-1', 2014, 1, '1018881530.jpg', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (53, 'AJAX и PHP. Разработка динамических веб-приложений', 'Книга "AJAX и PHP. Разработка динамических веб-приложений" - самый удобный и полезный ресурс, который поможет вам войти в захватывающий мир AJAX. Вы научитесь писать более эффективные веб-приложения на РНР за счет использования всего спектра возможностей технологий AJAX.', 'Кристиан Дари, Богдан Бринзаре, Филип Черчез-Тоза, Михай Бусика', '5-93286-077-4', 2009, 1, '1000389766.jpg', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (54, 'Разработка веб-приложений в ReactJS', 'ReactJS выделяется из массы прочих веб-фреймворков собственным подходом к композиции, который обеспечивает сверхбыстрое отображение. Из книги вы узнаете, как объединить конгломерат веб-технологий, окружающих ReactJS, в комплексный набор инструментов для построения современного веб-приложения. ', 'Адам Хортон, Райан Вайс', '978-5-94074-819-9', 2016, 1, '1014964317.jpg', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (55, 'XSLT', 'Цель книги - научить читателя эффективно использовать XSLT. Рассматриваются как XSLT 1.0, так и XSLT 2.0, а также версии 1.0 и 2.0 языка XPath. В спецификации XSLT 2.0 язык был дополнен рядом важных возможностей, многие из которых связаны с изменениями в XPath 2.0. ', 'Дуг Тидуэлл', '978-5-93286-150-9', 2010, 1, '1001423810.jpg', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (56, 'JavaScript. Шаблоны', 'Разработчики серверных, клиентских или настольных приложений на JavaScript нередко сталкиваются с проблемами, связанными с объектами, функциями, наследованием и другими особенностями этого языка. Какие же приемы разработки приложений на JavaScript являются наиболее удачными? Данная книга дает ответ на этот вопрос, предлагая большое количество различных шаблонов программирования на JavaScript...', 'Стоян Стефанов', '978-5-93286-208-7', 2011, 0, '1002535209.jpg', );
INSERT INTO book (id, title, description, autor, isbn, print_year, read_already, image_str, image_data) VALUES (57, 'Node.js. Разработка серверных приложений на JavaScript', 'Книга посвящена разработке веб-приложений в Node.js - платформе, которая выводит язык JavaScript за пределы браузера и позволяет использовать его в серверных приложениях. В основе платформы лежит исключительно быстрый движок JavaScript, заимствованный из браузера Chrome, к которому добавлена быстрая и надежная библиотека асинхронного сетевого ввода/вывода. ', 'Дэвид Хэррон', '978-5-97060-397-0', 2016, 0, '1018891586.jpg', );